import React from 'react';
import axios from "axios";

export default class ArchivePage extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            archives:"",
        };
    }

    componentDidMount() {
        axios("/listarchives").then(({ data }) => {
            this.setState({
                archives: data
            });
        });
    }


    render() {
        return(
            <div>
                {this.archives !== "" &&
                    <h1>TEST</h1>
                    (() => {
                        const options = [];

                        for (let i = 2017; i <= 2050; i++) {
                        options.push(<option value={i}>{i}</option>);
                        }

                        return options;
                    })()}
                    <h2>hwll</h2>

            </div>
        )
    };
};
